import React, {Component} from 'react';


class TimeCard extends Component {

    render() { 
        return (
            <div className="bgAll">
                <div style={{backgroundColor:this.props.backgroundColor}} className="bgProfileCard container d-flex justify-content-end align-items-center">
                    <img className="w-25 " src={this.props.logo}    /> 
                </div>
                    
                <div className="bgProfilebas2 container mb-4">
                    <div className="d-flex justify-content-between">
                        <p className="text-white mt-4 p-1">{this.props.titre}</p> 
                        <span className="text-white text-end mt-4 p-1">. . .</span>
                    </div>
                    <p className="text-white p-1">32hrs</p>
                    <p className="text-white mt-4">Last Week - 36hrs</p>
                </div>
            </div>
        );
    }
}

export default TimeCard;
